import React from "react";
import './Director.css';

export default function(){
    return(
        <>
        <div className="director1">
            <div className="direc1">
                <img src="./Images/director1.jpg" alt="" />
            </div>
            <div className="direc2">
                <div className="dir-msg-head">
                    MESSAGE FROM THE DIRECTOR
                </div>
            </div>
        </div>
        </>
    )
}
